import { TodoLists } from "./Pages/TodoLists";
import { GlobalStyle } from "./Style/GlobalStyle";
import { Link } from "react-router-dom";
import { AddPage } from "./Pages/AddPage";

function App() {
  return (
    <>
      <GlobalStyle />
      <div className="App">
        <Link to="/">
          <TodoLists />
        </Link>
        <Link to="/add">
          <AddPage />
        </Link>
      </div>
    </>
  );
}

export default App;
